 is new,\nI wish I didn't have to rhyme every time I sang,\n\nI was told when I get older all my fears would shrink,\nBut now I’m insecure and I care what people think.\nMy name’s ‘Blurryface’ and I care what you think\n\nWish we could turn back time, to the good ol’ days,\nWhen our momma sang us to sleep but now we’re stressed out.\n\nSometimes a certain smell will take me back to when I was young,\nHow come I’m never able to identify where it’s coming from,\nI’d make a candle out of it if I ever found it,\nTry to sell it, never sell out of it, I’d probably only sell one,\n\nIt’d be to my brother, ‘cause we have the same nose,\nSame clothes homegrown a stone’s throw from a creek we used to roam,\nBut it would remind us of when nothing really mattered,\nOut of student loans and treehouse homes we all would take the latter.\n\nMy name’s ‘Blurryface’ and I care what you think\n\nWish we could turn back time, to the good ol’ days,\nWhen our momma sang us to sleep but now we’re stressed out.\n\nWe used to play pretend, give each other different names,\nWe would build a rocket ship and then we’d fly it far away,\nUsed to dream of outer space but now they’re laughing at our face,\nSaying, “wake up, you need to make money.\"\n\nWish we could turn back time, to the good ol’ days,\nWhen our momma sang us to sleep but now we’re stressed out.\n\n"},{"text":"#twentyonepilots","navigationEndpoint":{"clickTrackingParams":"CJwBENzXBBgmIhMI3f-dq5749AIVjxyyCh1NPAwp","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/twentyonepilots","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gURCg90d2VudHlvbmVwaWxvdHM%3D"}},"loggingDirectives":{"trackingParams":"CJwBENzXBBgmIhMI3f-dq5749AIVjxyyCh1NPAwp","visibility":{"types":"12"}}},{"text":" "},{"text":"#StressedOut","navigationEndpoint":{"clickTrackingParams":"CJsBENzXBBgoIhMI3f-dq5749AIVjxyyCh1NPAwp","commandMetadata":{"webCommandMetadata":{"url":"/
